INSERT INTO `ARVORES` (`id`, `nome_comum`, `especie`, `familia`, `cap`, `altura_total`, `classe_copa`, `sanidade`, `crescimento`, `pos_sociologica`, `utilizacao`, `caracteristicas`, `img_arvore`, `latitude`, `longitude`, `data_registro`, `validado`, `id_usuario`) VALUES
(1, 'Amoreira', 'Morus nigra', 'Moraceae', 2.33, 8, 'ampla', 'boa', 'normal', 'isolada', 'Comercialização dos frutos e paisagismo', 'Morus é o nome de um género de árvores caducifólias, que são conhecidas por amoreiras, nativas das regiões temperadas e subtropicais da Ásia, África e América do Norte, sendo que a maioria das espécies do género é asiática.\r\nAs plantas do género Broussonetia, intimamente relacionado com o Morus, são também vulgarmente conhecidas por amoreiras, nomeadamente a Amoreira de papel (Broussonetia papyrifera).', , '-20.46971049', '-54.62012110', '2018-03-08 15:16:16', 1, 1);
INSERT INTO `ARVORES` (`id`, `nome_comum`, `especie`, `familia`, `cap`, `altura_total`, `classe_copa`, `sanidade`, `crescimento`, `pos_sociologica`, `utilizacao`, `caracteristicas`, `img_arvore`, `latitude`, `longitude`, `data_registro`, `validado`, `id_usuario`) VALUES
(2, 'Mangueira', 'Mangifera indica', 'Anacardiaceae', 4.96, 16, 'ampla', 'boa', 'normal', 'isolada', 'Comercialização dos frutos', 'Mangifera indica é uma espécie de planta da família Anacardiaceae. Pode ser encontrada na forma nativa nas florestas do sul e sudeste da Ásia, tendo sido introduzida em várias regiões do Mundo. A espécie foi levada para Ásia em torno de 400-500 aC a partir da Índia; seguindo, no século 15 para as Filipinas, sendo levada à África e ao Brasil pelos colonizadores portugueses no século XVI.', , '-16.46582833', '-54.57966059', '2018-03-10 01:29:47', 1, 1);